■機動力を手に入れろ！足に様々なものを取り付けられる新感覚ホルスター<br><br>

足にギアを集約させることで肩を開放するためのホルスター。感度が求められる釣りで肩が自由になればより釣りに集中でき、太腿で固定するタイプで機動力にも優れる。
ユーザー自身で自由にカスタムできることもメリットで、iPhoneケースや月下美人モバイルワレット、ロッドホルスターなど様々な物が自由に取り付け可能。
また別売りのフィッシングベルトにもセット可能。お気に入りのタックルをかっこよく身に着け、身軽で手軽な釣りを楽しもう。<br><br>

